import {
  Box,
  Button,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
} from "@material-ui/core";
import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { acGetUsersRequest, getOrderRequest } from "./../../../../Actions";
import OrderItem from "./../../../../Components/MemberShip/Order/OrderItem";

export default function Order() {
  const users = useSelector((state) => state.users);
  const orders = useSelector((state) => state.order);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(acGetUsersRequest());
    dispatch(getOrderRequest());
  }, []);

  const handleAccept = (id, uid) => {
    let index = users.findIndex((user) => user.id === id);
    let listOrder = users[index].myProducts;
    let indexOrder = listOrder.findIndex((item) => item.id === uid);
    let user = {
      myProducts: listOrder,
    };
  };

  return (
    <Box
      className="body-admin m-0 pt-5 px-3 bgr-admin"
      sx={{ minHeight: "100vh" }}
    >
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Email</TableCell>
            <TableCell>List Order</TableCell>
            <TableCell colSpan="2">Action</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {orders.map((item, index) => {
            return (
              <TableRow key={index}>
                <TableCell>{index + 1}</TableCell>
                <TableCell>{item.email}</TableCell>
                <TableCell>
                  <OrderItem item={item} color="text-dark" />
                </TableCell>
                <TableCell>
                  <Button onClick={() => handleAccept(item.id)}>Accept</Button>
                </TableCell>
                <TableCell>
                  <Button>Cancel</Button>
                </TableCell>
              </TableRow>
            );
          })}
        </TableBody>
      </Table>
    </Box>
  );
}
